import Sidebar from '../Sidebar/Sidebar';
import MainContent from '../MainContent/MainContent';

const Dashboard = ({route})=> (
    <div>
        <Meta pageTitle="Dashboard - EazyRent"/>
        <div className="app">
            <Sidebar/>
            <MainContent content={route}/>
            <style jsx>
                {`
                    .app{
                        width: 100%;
                        height: 100vh;
                        display: flex;
                    }

                    .app > *{
                        height: inherit;
                    }
                `}
            </style>
        </div>
    </div>
);

export default Dashboard;
